ontology:
@prefix : <http://www.example.org/test#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

<http://www.example.org/test#> a owl:Ontology .

:Bell rdf:type owl:Class ;
    rdfs:label "Bell"@en ;
    rdfs:comment "A bell in a bell tower."@en .

:MountingSystem rdf:type owl:Class ;
    rdfs:label "Mounting System"@en ;
    rdfs:comment "A system used to mount a bell."@en .

:hasMountingSystem rdf:type owl:ObjectProperty ;
    rdfs:domain :Bell ;
    rdfs:range :MountingSystem ;
    rdfs:label "has mounting system"@en ;
    rdfs:comment "The mounting system of a bell."@en .

:BellTower rdf:type owl:Class ;
    rdfs:label "Bell Tower"@en ;
    rdfs:comment "A tower that houses bells."@en .

:Church rdf:type owl:Class ;
    rdfs:label "Church"@en ;
    rdfs:comment "A place of worship."@en .

:hasBellTower rdf:type owl:ObjectProperty ;
    rdfs:domain :Church ;
    rdfs:range :BellTower ;
    rdfs:label "has bell tower"@en ;
    rdfs:comment "The bell tower associated with a church."@en .

:hasBell rdf:type owl:ObjectProperty ;
    rdfs:domain :BellTower ;
    rdfs:range :Bell ;
    rdfs:label "has bell"@en ;
    rdfs:comment "The bell housed in the bell tower."@en .

:location rdf:type owl:DatatypeProperty ;
    rdfs:domain :Church ;
    rdfs:range xsd:string ;
    rdfs:label "location"@en ;
    rdfs:comment "The address or location of the church."@en .

:material rdf:type owl:DatatypeProperty ;
    rdfs:domain :Bell ;
    rdfs:range xsd:string ;
    rdfs:label "material"@en ;
    rdfs:comment "The material the bell is made of."@en .

:weight rdf:type owl:DatatypeProperty ;
    rdfs:domain :Bell ;
    rdfs:range xsd:decimal ;
    rdfs:label "weight"@en ;
    rdfs:comment "The weight of the bell."@en .

:measurement rdf:type owl:DatatypeProperty ;
    rdfs:domain :Bell ;
    rdfs:range xsd:string ;
    rdfs:label "measurement"@en ;
    rdfs:comment "The measurements of the bell."@en .

:RingingMethod rdf:type owl:Class ;
    rdfs:label "Ringing Method"@en ;
    rdfs:comment "The method used to ring the bell."@en .

:hasRingingMethod rdf:type owl:ObjectProperty ;
    rdfs:domain :Bell ;
    rdfs:range :RingingMethod ;
    rdfs:label "has ringing method"@en ;
    rdfs:comment "The method used to ring the bell (e.g., manual or electric)."@en .

:SoundDocument rdf:type owl:Class ;
    rdfs:label "Sound Document"@en ;
    rdfs:comment "A recording of the sound produced by the bell or bell tower."@en .

:documents rdf:type owl:ObjectProperty ;
    rdfs:domain :SoundDocument ;
    rdfs:range :BellTower ;
    rdfs:label "documents"@en ;
    rdfs:comment "Associates a sound document with a bell tower."@en .

:PerformerGroup rdf:type owl:Class ;
    rdfs:label "Performer Group"@en ;
    rdfs:comment "A group of individuals who perform bell ringing."@en .

:performsAt rdf:type owl:ObjectProperty ;
    rdfs:domain :PerformerGroup ;
    rdfs:range :BellTower ;
    rdfs:label "performs at"@en ;
    rdfs:comment "Indicates where a performer group performs."@en .

:ageGroup rdf:type owl:DatatypeProperty ;
    rdfs:domain :PerformerGroup ;
    rdfs:range xsd:string ;
    rdfs:label "age group"@en ;
    rdfs:comment "The age group of the performers."@en .

:gender rdf:type owl:DatatypeProperty ;
    rdfs:domain :PerformerGroup ;
    rdfs:range xsd:string ;
    rdfs:label "gender"@en ;
    rdfs:comment "The gender of the performers."@en .

:transmissionMethod rdf:type owl:DatatypeProperty ;
    rdfs:domain :PerformerGroup ;
    rdfs:range xsd:string ;
    rdfs:label "transmission method"@en ;
    rdfs:comment "The method of knowledge transmission (oral, written, formal, informal)."@en .
